<?php

declare(strict_types=1);


namespace Armstrong1992\ZplImageToolBox\Tests\Unit;

use Armstrong1992\ZplImageToolBox\Exception\ImageFactoryException;
use Armstrong1992\ZplImageToolBox\ImageData\DecodedImageDataInterface;
use Armstrong1992\ZplImageToolBox\ImageFactory;
use Armstrong1992\ZplImageToolBox\Tests\TestUtils;
use Imagick;
use PHPUnit\Framework\Attributes\CoversClass;
use PHPUnit\Framework\Attributes\DataProvider;
use PHPUnit\Framework\TestCase;

#[CoversClass(ImageFactory::class)]
final class ImageFactoryTest extends TestCase
{
    #[DataProvider('provideTestData')]
    public function testCreate(
        int    $imageDataSize,
        int    $imageDataRowSize,
        string $decodedImageData,
        string $referenceFileName
    ): void
    {
        $imageFactory = new ImageFactory();

        $imageData = $this->createMock(DecodedImageDataInterface::class);
        $imageData->method('data')->willReturn($decodedImageData);
        $imageData->method('imageDataSize')->willReturn($imageDataSize);
        $imageData->method('imageDataRowSize')->willReturn($imageDataRowSize);

        $referenceImage = new Imagick(TestUtils::getReferenceImagePath($referenceFileName));

        ob_start();

        imagejpeg($imageFactory->create($imageData));

        $resultingImgData = ob_get_clean();

        $imageToCompare = (new Imagick());
        $imageToCompare->readImageBlob($resultingImgData);

        $imgDiff = $imageToCompare->compareImages($referenceImage, Imagick::METRIC_MEANSQUAREERROR);

        $this->assertEquals(0.0, $imgDiff[1]);

    }

    public function testPassedInvalidData(): void
    {
        $imageData = $this->createMock(DecodedImageDataInterface::class);
        $imageData->method('data')->willReturn('asd');

        $imageFactory = new ImageFactory();

        $this->expectException(ImageFactoryException::class);
        $this->expectExceptionMessage('Provided image data is not valid. (Image data must be in form of a HEX string.)');

        $imageFactory->create($imageData);
    }

    public static function provideTestData(): \Generator
    {
        yield [
            35770,
            70,
            '',
            'first_label_reference.jpg',
        ];
        yield [
            37518,
            78,
            '',
            'second_label_reference.jpg',
        ];
    }
}
